function App() {
  return (
    <div className="App">
      <div className='logo-contenedor'>
        <img
          src={ logospiderman }
          className='logo'/>
      </div>
      <div className='tareas'>
        <center><h1>Mis SpiderTareas</h1></center>
        <TareaFormulario/>
      </div>
    </div>
  );
}

export default App;
